using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIDictationPhraseClass/index.html#//apple_ref/occ/cl/UIDictationPhrase	/// <summary>	/// A dictation phrase object represents the textual interpretation of a spoken phrase as dictated by a user.	/// </summary>	[iOSVersion(5.1)]	public class UIDictationPhrase : NSObject	{		/// <summary>		/// An array of alternative textual interpretations of a dictated phrase. (read-only)		/// </summary>		[iOSVersion(5.1)]		[Export("alternativeinterpretations")]		public AnyObject[] Alternativeinterpretations { get; private set; }				/// <summary>		/// The most likely textual interpretation of a dictated phrase. (read-only)		/// </summary>		[iOSVersion(5.1)]		[Export("text")]		public string Text { get; private set; }	}}